import { StyleSheet, css } from "aphrodite";
import React from "react";

const Home = () => {
	return (
		<div className={css(classes.root)}>
			<div className={css(classes.homeContents)}>
				<div className={css(classes.textContents)}>
                    <div className={css(classes.name)}></div>
                </div>
				<div className={css(classes.imgContents)}></div>
			</div>
		</div>
	);
};

const classes = StyleSheet.create({
	root: {
		position: "relative",
		backgroundColor: "#1C1B1B",
		width: "100%",
		height: "100vh",
	},
	homeContents: {
		border: "1px solid white",
		width: "66%",
		height: "55%",
		marginLeft: "18%",
		marginRight: "18%",
		display: "flex",
		flexDirection: "row",
	},
	textContents: {
		display: "flex",
		flexDirection: "column",
	},

});

export default Home;
